Palabra Cadabra, the Anagram Game is the new multilanguage game in which your mind will be put to the test. Can you discover the words inside other words to score points and increase the tension of the music?

- The clock is ticking! Tick tack... You have 60 seconds to discover the anagrams inside a word, and earn more time when you discover each one;
- The music and rhythm complexity change as your score increases;
- Listen to sound effects which inform you of your score, mistakes and time remaining;
- Are you learning Spanish or Catalan? Change the language of the words right from within the app without changing your device language (more languages soon!;
- brag about your highest scores with your friends;
- Use your Bluetooth keyboard or the big onscreen keyboard provided;
- Fully accessible to voiceover users and persons with and without disabilities.
